import React, { Component } from 'react';
import * as ReactBootStrap from "react-bootstrap"
import "./Navbar.css"

class Pageheader extends Component {
    state = {
    };

    style = {
        margin: 0,
        padding: 5,
        fontSize: 20,
        color: "#FFFFFF"
    };

    render() {
        return (
            <ReactBootStrap.Navbar style={this.style}>
                <ReactBootStrap.Navbar.Brand href="#home">indigo</ReactBootStrap.Navbar.Brand>
                <ReactBootStrap.Navbar.Collapse>
                    <ReactBootStrap.Navbar className={"ml-auto"}/>
                </ReactBootStrap.Navbar.Collapse>
                <ReactBootStrap.Nav className="mr-auto" style={this.style}>
                    <ReactBootStrap.Nav.Link href="#aboutus">About us</ReactBootStrap.Nav.Link>
                    <ReactBootStrap.Nav.Link href="#contactus">Contact us</ReactBootStrap.Nav.Link>
                    <ReactBootStrap.Nav.Link href="#login">Login</ReactBootStrap.Nav.Link>
                </ReactBootStrap.Nav>
                <ReactBootStrap.Form inline>

                </ReactBootStrap.Form>
            </ReactBootStrap.Navbar>
        );
    }

}

export default Pageheader;
